import axios from 'axios';

function App() {


  const getData = async () => {
    try {
      const { data } = await axios.get('/api/allpins');
      console.log(data);
    } catch (error) {
      console.log('ERROR!', error);
    }
  };

  return (
    <div>
      <button onClick={getData}>press me</button>
    </div>
  );
}

export default App;
